webpackJsonp([64545416611969],{1116:function(o,e){o.exports={data:{site:{siteMetadata:{title:"Gatsby Starter - Forty by HTML5 UP",author:"Hunter Chang"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/foxmarks/index.md absPath of file >>> MarkdownRemark",html:'<p>Foxmarks is a add-on for firefox, which syncronizes your bookmarks between computers. Soo, if you have your home computer and a work computer, for example, you can sync the bookmarks up automatically. Cool huh?</p>\n<p>Well, where it could really come in useful would be in an office where everyone might want to have a common library of useful links in their web-browser. Anyone can add everything to a central sync server and bobs your uncle!</p>\n<p>Head on over to <a title="Open this link in a new window." href="http://www.foxmarks.com/" target="_blank">http://www.foxmarks.com/</a> for more info.</p>',frontmatter:{title:"Foxmarks",date:"March 02, 2007",tags:null}}},pathContext:{}}}});
